import React from 'react';

const { Layout } = antd;

const { Header, Footer, Sider, Content } = Layout;

const LayoutAnt = ({ children }) => <Layout>
  <Header>Header</Header>
  <Layout>
    <Sider>Sider</Sider>
    <Content>{children}</Content>
  </Layout>
  <Footer>Footer</Footer>
</Layout>;

export default ({ Component, pageProps }) => (
  <LayoutAnt>
    <Component {...pageProps} />
  </LayoutAnt>
)
